import React from 'react';
import Swanspiration from '../Swanspiration/Swanspiration'
import './spellInspirations.css';


const SpellInspirations = ({ spells }) => {

  const quoteDisplay = spells.map(spells => {
    return (
        <Swanspiration
         key={quote.id}
         id={quote.id}
         kittenFamiliar={quote.kittenFamiliar}
         swanspiration={quote.swanspiration}
         keep={quote.keep}
        />
      )

  })

  return(
    <article className='spell-box'>
      { quoteDisplay }
    </article>
  )
}

export default SpellInspirations;
